  methods: {
    getLetters: function(word) {
      var temp = word.split(/(?=అ|ఆ|ఇ|ఈ|ఉ|ఊ|ఎ|ఏ|ఐ|ఒ|ఓ|ఔ|క|ఖ|గ|ఘ|చ|ఛ|జ|ఝ|ట|ఠ|డ|ఢ|ణ|త|థ|ద|ధ|న|ప|ఫ|బ|భ|మ|య|ర|ల|వ|శ|ష|స|హ|ళ|క్ష|ఱ)/g);
      var joinletter = false;
      var letters=[];
      _(temp).forEach(function(v,i) {
        if(joinletter) {
          joinletter=_(v).endsWith("్");
          letters[letters.length-1]+=v;
        }else 
          letters.push(v);
        if(_(v).endsWith("్"))
          joinletter = true;

      })
      return letters;
    },
    newboard: function() {
      this.boardWords = _(this.letters).sampleSize(8).value();
      this.boardWordsMap = _(this.boardWords).map(function(v,i) {var obj={}; obj[v.join("")]=i; return obj;}).value();
      this.board = _(this.boardWords).flatten().shuffle().map(function(v,i) { return {pos:i, letter:v, color:(i%2==0?'#fff':'#f9f9f9')};}).value();
    },
    selectedLetter: function(letter) {
      letter.color = "#81d4fa";
      this.selectedWord.push(letter);
    },
    deleteLetter: function(index) {
      var pos = this.selectedWord[index].pos;
      this.board[pos].color=pos%2==0?"#fff":"#f9f9f9";
      this.selectedWord.splice(index,1);
    },
    validateword: function() {
      debugger;
      var word = _(this.selectedWord).reduce(function(a,v) { return a+v.letter;},"");
      if(this.boardWordsMap[word]>=0) {
        this.boardWordsMap[word]=true;
        this.selectedWord=[];
      }
      if(this.words[word])
        this.selectedWord=[];
    }
      
    },
    created() {
      this.newboard();
      new Impetus({
        source: ".letterbox",
        update: function(x, y) {

            // whatever you want to do with the values
        }
      });
    }
  }
